	["so_purple"] = { name = "Ultraviolet", desc = "Den har individuelle deler sprøytelakkert i solide farger fra en svart og lilla fargepalett.\n\nElegant design satt sammen med brutal hensikt." },
	["so_night"] = { name = "Night", desc = "Den har individuelle deler sprøytelakkert i solide farger fra en nattlig fargepalett.\n\nDet er vindens melodi – det er tennene i nakken din." },
