	["so_sand"] = { name = "Sand Dune", desc = "Den har individuelle deler sprøytelakkert i solide farger fra en sandfargepalett.\n\nSiden Turner er død, har vi en ny prioritet: Redd Alex Kincaide. – Felix Riley, kommanderende offiser" },
	["so_stormfront"] = { name = "Storm", desc = "Den har individuelle deler sprøytelakkert i solide farger fra en stormfargepalett.\n\nDen venter på deg ved enskinnebanen." },
	["so_tornado"] = { name = "Tornado", desc = "Den har individuelle deler sprøytelakkert i solide farger fra en tornadofargepalett.\n\nIkke la deg lure av den enkle utformingen." },
	["so_whiteout"] = { name = "Whiteout", desc = "Den er sprøytelakkert helt hvit.\n\nDen ser ren ut, men skinnet kan bedra." },
	["so_jungle"] = { name = "Jungle", desc = "Den har individuelle deler sprøytelakkert i solide farger fra en jungelfargepalett." },
	["so_space_marine"] = { name = "Colony", desc = "Den har individuelle deler sprøytelakkert i grå og khaki." },
	["so_pmc"] = { name = "Contractor", desc = "Den har individuelle deler sprøytelakkert brune, marineblå og mørkegrønne.\n\nRona Sabri har fortsatt ikke tilgitt Sebastien for å ikke velge henne til jakten på Turner." },
	["so_tangerine"] = { name = "Demolition", desc = "Den har individuelle deler sprøytelakkert i svart og mandarinoransje.\n\nRona er så god som hun tror hun er … hun er bare ikke gammel nok til å innse at hun ikke bør poengtere det for alle. – Felix Riley, kommanderende offiser" },
	["so_orange_accents"] = { name = "Nitro", desc = "so_orange_accents" },
