	["an_silver"] = { name = "Silver", desc = "Den er påført en krom grunning og blanklakkert i en gjennomsiktig, anodisert sølvfarget effektlakk.\n\nDet er skjønnhet i enkelhet. – Franz Kriegeld, Phoenix-taktiker" },
	["an_red"] = { name = "Hot Rod", desc = "Den er påført en krom grunning og blanklakkert i en gjennomsiktig, anodisert rød effektlakk.\n\nAutomatisk. Høytraumatisk. Hipp-og-kul-og-sjekke-praktisk." },
	["an_gunmetal"] = { name = "Anodized Gunmetal", desc = "an_gunmetal" },
	["an_navy"] = { name = "Anodized Navy", desc = "Den er påført en krom grunning og blanklakkert i en gjennomsiktig, anodisert marineblå effektlakk." },
	["am_urban"] = { name = "Metallic DDPAT", desc = "Den er lakkert i et urbant «Digital Disruptive»-mønster (DDPAT) med hydrografikk, over en metallisk grunning." },
	["am_tiger"] = { name = "Gold Tiger", desc = "Den er gullbelagt og håndgravert i et tigermønster." },
	["am_dragon_glock"] = { name = "Dragon Tattoo", desc = "Den er lakkert med et drageoverføringsbilde over en metallisk grunning.\n\nI eventyr dreper ridderen alltid dragen … men dette er den virkelige verden. – Valeria Jenner, revolusjonær" },
	["am_caustics"] = { name = "Caustics", desc = "Den er lakkert i rødt og hvitt med hydrografikk, over en trekullmetallisk grunning." },
	["am_lightning_awp"] = { name = "Lightning Strike", desc = "Den er lakkert med et motiv av et lynnedslag ved hjelp av elokserende effektmaling over en metallisk grunning.\n\nNoen ganger trenger man ikke treffe samme sted to ganger." },
	["am_ossify"] = { name = "Ossified", desc = "Den er lakkert i et gjennomsiktig, limegrønt og abstrakt mønster med hydrografikk, over en metallisk grunning." },
	["aa_flames"] = { name = "Blaze", desc = "Den er sprøytelakkert i gjennomsiktige malinger, over en krom grunning." },
	["aa_splash_p250"] = { name = "Splash", desc = "Den er sprøytelakkert i gjennomsiktige malinger med en sjablong, over en krom grunning." },
	["aa_fade"] = { name = "Fade", desc = "Den er sprøytelakkert i gjennomsiktige malinger som toner sammen over en krom grunning.\n\nDette er ikke bare et våpen, det er et samtaleemne. – Imogen, våpenhandler under opplæring" },
	["aa_fade_metallic"] = { name = "Amber Fade", desc = "aa_fade_metallic" },
	["aa_fade_grassland"] = { name = "Acid Fade", desc = "aa_fade_grassland" },
	["aq_copper"] = { name = "Copper", desc = "Den er kobberbelagt." },
	["aq_blued"] = { name = "Blue Steel", desc = "Den er kaldblånert.\n\nDette er våpendesignets svar på malbec – Booth, våpenhandler" },
	["aq_forced"] = { name = "Stained", desc = "Den har en tvungen patina ved å dryppe sitron og sennep på overflaten.\n\nHvis du synes den er skitten nå, bare vent til du ser den under et ultrafiolett lys" },
	["aq_oiled"] = { name = "Case Hardened", desc = "Den er settherdet gjennom anvendelse av varmt trekull.\n\nLitt farge skadet aldri noen" },
	["sp_spitfire_famas"] = { name = "Spitfire", desc = "sp_spitfire_famas" },
	["am_zebra"] = { name = "Slaughter", desc = "Den er lakkert i et sebrastripet mønster med aluminium og kromfarger med ulike refleksjonsevner, den har så blitt dekket med et lag tomatrød lakk.\n\nValeria betaler ikke Javier for å stille spørsmål … hun betaler ham for å tvinge ut svar." },
	["am_zebra_dark"] = { name = "Dark Water", desc = "Den er lakkert i vannaktige striper med trekullmetalliske malinger med ulike refleksjonsevner, over en krom grunning.\n\nVann gir liv, men det kan også ta liv …" },
	["aa_vertigo"] = { name = "Hypnotic", desc = "Den er lakkert med en perlegrunning, og så sprøytelakkert svart gjennom en sjablong i et grafisk mønster.\n\nDu er ikke i ferd med å bli trøtt, du er i ferd med å besvime på grunn av blodtap." },
	["cu_spring_nova"] = { name = "Bloomstick", desc = "Den er sprøytelakkert for hånd med et kirsebærblomstmotiv, og så fått en topplakkering i høyglans." },
	["sp_hazard"] = { name = "Hazard", desc = "sp_hazard" },
	["aq_rust"] = { name = "Rusty", desc = "Selv om de eksterne overflatene har rustet, er våpenet fortsatt i perfekt operasjonell stand." },
	["am_slither_p90"] = { name = "Cold Blooded", desc = "Den er påført en krom grunning og blanklakkert i en gjennomsiktig, rød anodisert effektlakk. Deretter er den blitt lasergravert med et slangemotiv." },
	["am_carbon_fiber"] = { name = "Carbon Fiber", desc = "Den er lakkert i karbonfiber med hydrografikk, over en grafittgrunning.\n\nSelv om jeg bar laget på mine skuldre, betyr ikke det at det ikke var lagarbeid. – Rona Sabri, kommende stjerne" },
	["am_scorpion_p2000"] = { name = "Scorpion", desc = "Den er lakkert med anodiseringseffektmalinger i et bølget, bleknet mønster med et rødt skorpionoverføringsbilde på skjeftet." },
	["hy_feathers_aug"] = { name = "Wings", desc = "Den er dekorert med et selvklebende overføringsbilde av ørnefjær.\n\nEn ørn ser majestetisk ut, helt til den pirker ut øynene dine" },
	["sp_palm_shadow"] = { name = "Tropical Storm", desc = "sp_palm_shadow" },
