	["cu_fireserpent_ak47_bravo"] = { name = "Fire Serpent", desc = "Denne suveniren fra Ruins er lakkert med et slange- og brannmotiv.\n\nHvis du vil overleve på gaten, bør du lære deg å spytte flammer." },
