	["cu_season_elites_bravo"] = { name = "Black Limba", desc = "Denne suveniren fra Agency har en mørk patina og skjefte med svart limbatre.\n\nHvor klassisk konstruksjon møter moderne estetikk" },
	["hy_seaside_bravo"] = { name = "Tempest", desc = "Denne suveniren fra Seaside er lakkert i et bølge- og skymotiv med hydrografikk.\n\nEn storm er på vei." },
