	["hy_crumple_bravo"] = { name = "Shattered", desc = "Denne suveniren fra Agency er lakkert i et mangekantmønster med hydrografikk.\n\nMine menn er fagfolk, de får jobben gjort skikkelig … – Elliott Kingsman, yrkeskriminell" },
