	["hy_ali_tile_bravo"] = { name = "Mosaico", desc = "hy_ali_tile_bravo" },
	["an_emerald_bravo"] = { name = "Emerald", desc = "Denne suveniren fra Chinatown er påført en krom grunning og blanklakkert i gjennomsiktig, anodisert smaragdeffektlakk.\n\nEr dette det den store Sebastien Hennequet er blitt redusert til? En grinete skolefrøken? Hva skjedde med deg … – Læreren og ikonoklasten, del 2" },
	["hy_mayan_dreams_bravo"] = { name = "Mayan Dreams", desc = "Denne suveniren fra Ruins er lakkert i et mayansk skymotiv med hydrografikk.\n\nNoen ganger kreves det et offer." },
