	["cu_pinstripe_ak47"] = { name = "Emerald Pinstripe", desc = "Den har en geværkolbe av gammel eik, og er malt i hvite og grønne nålstriper.\n\nTviler du på Imogen, tviler du på meg. Så slapp av, ta litt whisky og la oss snakke forretninger. – Faderen og Phoenix, del 2" },
