	["am_metals"] = { name = "Knight", desc = "Den har messinginnlegg i et renessanserustningtema.\n\nHva mener du med at du ikke kan finne Cocinero og Izaki? – Felix Riley, kommanderende offiser" },
	["am_chainmail"] = { name = "Chainmail", desc = "Den er lakkert i et halvgjennomsiktig brynjemønster med hydrografikk, over en sølvfarget grunning.\n\nAv alle Phoenix' medlemmer, er ingen mer lojale overfor Valeria enn livvakten hennes, Naomi." },
	["aq_handcannon"] = { name = "Hand Cannon", desc = "Den har messingdeler som har en syrepatina inspirert av antikke messingkanoner.\n\nVær forberedt på å møte mange torner i de kommende prøvelsene" },
	["am_metal_inlay"] = { name = "Dark Age", desc = "Den er lakkert i metallisk lakk så det ser ut som om den er innlagt med metaller i et middelaldermotiv.\n\nJeg kunne drept hennes elskede … kanskje det ville gitt deg litt tid med Valeria. – Faderlig kjærlighet, del 2" },
