	["so_indigo"] = { name = "Royal Blue", desc = "Den er lakkert med solide farger i indigo, høyrød og grå.\n\nDu burde smile, Felix, du ville hatt mer hell med damene hvis du ikke hadde sett ut som en dyster drittsekk hele tiden. – Imogen, våpenhandler under opplæring" },
	["so_indigo_and_grey"] = { name = "Indigo", desc = "Den er lakkert med solide farger i indigo, blå og grå.\n\nAlex Kincaide, du har nok mange spørsmål … la meg gi deg noen svar. – Phoenix og historiefortelleren, del 1" },
	["cu_well_traveled_ak47"] = { name = "Jet Set", desc = "Kolben er innpakket i brunt lær. Dette våpenet har vært i mange byer.\n\nEnhver som er oppmerksom kommer til å legge sammen to og to, og finne ut det hun gjorde. Vi har ikke mye tid til å finne en løsning... – Faderlig kjærlighet, del 1" },
