	["cu_luggage_mac10"] = { name = "Commuter", desc = "Den er lakkert i et rutete mønster med hydrografikk, og delvis pakket inn i falskt krokodilleskinn.\n\nDe tok agnet, nå slår vi til … – Elliott Kingsman, leiesoldat " },
	["cu_medieval_dragon_awp"] = { name = "Dragon Lore", desc = "Den er spesiallakkert med bilde av en drage i et design med en keltisk knute.\n\nSelv 200 nøkler ville aldri kunne låst opp dens hemmeligheter." },
	["cu_luggage_p2000"] = { name = "Coach Class", desc = "Den er lakkert i et rutete mønster med hydrografikk, og deler av skjeftet er pakket inn i brunt lær.\n\nDen er ikke så stilig, men den tar deg dit du trenger." },
