	["cu_leather_xm1014"] = { name = "Red Leather", desc = "Skjeftet er innpakket i rødt lær.\n\nPakk sakene dine. La oss drepe den jævelen... – Oni og Valkyrjen, del 2" },
	["cu_luggage_sg553"] = { name = "Traveler", desc = "Den er spesiallakkert i et stripete design, inspirert av gammeldags bagasje, og noen deler er pakket inn i brunt lær.\n\nAlle har en historie, og Javier lirker det ut før han dreper deg." },
	["cu_luggage_usp-s"] = { name = "Business Class", desc = "Den er spesiallakkert i farger og mønster inspirert av gammeldags bagasje, og noen deler er pakket inn i brunt lær.\n\nNoen vil ikke bare ha ekstra beinplass … de vil ha fred og ro." },
	["hy_plaid1"] = { name = "Olive Plaid", desc = "Den er lakkert i et rutete, beige og olivengrønt mønster med hydrografikk.\n\nJeg liker den. Den fremhever øynene mine i kameraet … – Rona Sabri, kommende stjerne" },
