	["cu_tribute_ak47"] = { name = "Wasteland Rebel", desc = "Den er patinert, blokktrykket og lakkert med graffiti.\n\nEn dag kommer de til å spørre hvorfor vi kjemper, og først da vil de forstå. – Naomi, livvakten til Valeria Jenner" },
