	["cu_galil_abrasion"] = { name = "Chatterbox", desc = "Den er lakkert for hånd og patinert. Skallen på støvdekselet ser ut som den snakker når sluttstykket går frem og tilbake.\n\nDet sies at når du ler, så ler verden med deg … men når Chatterbox ler, høres bare skrik." },
	["cu_glock_deathtoll"] = { name = "Catacombs", desc = "Den er lakkert med skallehydrografikk over en grunning i metallisk sølv.\n\nTrusler er den mest oppriktige formen for smiger." },
	["cu_m4a4_ancestral"] = { name = "龍王 (Dragon King)", desc = "Den er lakkert med et bilde av en drage i rødt og blått.\n\nEt våpen verdig selveste Monkey King. – Booth, våpenhandler" },
	["cu_m249_sektor"] = { name = "System Lock", desc = "Den er lakkert med et sci-fi-design.\n\nDekningsild har aldri sett så bra ut." },
	["am_mac10_malachite"] = { name = "Malachite", desc = "Den er lakkert med metalliske detaljer og påført et bølgemønster ved hjelp av en gummikam.\n\nLyse farger skjuler et våpen med et mørkt formål." },
	["cu_mp9_deadly_poison"] = { name = "Deadly Poison", desc = "Den er lakkert med dynamiske og kantede former, og en stilisert edderkopp.\n\nDet er ikke det første bittet som dreper deg – det er de 29 som kommer etter." },
	["cu_p250_mandala"] = { name = "Muertos", desc = "Den er lakkert med sirkelmotiver.\n\nDenne er dynket i tradisjon og blod." },
	["cu_sawedoff_deva"] = { name = "Serenity", desc = "Den er lakkert med et bilde av en kvinne med vinger.\n\nSinnsro er en luksus få kan koste på seg. – Valeria Jenner, revolusjonær" },
	["aq_scar20_leak"] = { name = "Grotto", desc = "Den er lakkert med svamp og pensel med blå metalliske detaljfarger.\n\nGrunnleggeren av Season Corporation bestilte dette verket etter å ha blitt reddet av den berømte agenten Kotaro Izaki." },
	["aq_xm1014_sigla"] = { name = "Quicksilver", desc = "Den er lakkert med gjennomsiktig hydrografikk med et terrengkartmotiv over metallisk sølvmaling.\n\nAv og til trenger du et ustabilt element for å løse problemene dine. – Kotaro Izaki, inntrengingsekspert" },
	["an_tiger_orange"] = { name = "Tiger Tooth", desc = "Den er anodisert med oransje og håndgravert med et tigermønster.\n\nSom tigeren er den sjelden … som tigeren er den dødelig …" },
	["am_marble_fade"] = { name = "Marble Fade", desc = "Den er lakkert med metalliske farger i svart og sølv med marmorering, og så blanklakkert i tre farger.\n\nBladet er mangefarget, men snart er det bare rødt." },
	["am_marbleized"] = { name = "Doppler", desc = "Den er lakkert med metalliske farger i svart og sølv med marmorering, og så blanklakkert.\n\nÅ miste seg i fargene kan være dødelig." },
	["cu_ak47_mastery"] = { name = "Elite Build", desc = "It has been custom painted using a combination of hydrographics and careful stenciling and detailed with heat-transfer decals.\n\nTread softly Naomi...people in your line of work aren't known for their longevity - The Shield and The Serpent Part 2" },
	["aq_mp7_ultramodern"] = { name = "Armor Core", desc = "Den er malt med svart oljemaling og påført deler og innlegg av børstet stål.\n\nPerfekt for agenter som setter pris på raffinement så vel som ildkraft. – Booth, våpenhandler" },
	["aq_awp_twine"] = { name = "Worm God", desc = "Den er lakkert med et bilde av en hodeskalle og røtter ved bruk av slitesterk emaljelakk.\n\nDet finnes noen røtter du ikke vil at skal slå rot." },
	["am_bronze_sparkle"] = { name = "Bronse Deco", desc = "Den er lakkert med et art deco-mønster i metallisk billakk.\n\nAlle leter etter gull og sølv." },
	["aq_p250_contour"] = { name = "Valence", desc = "Den er lakkert med et blått og grått design som fyller ut våpenets form.\n\nDet er holdningen din det er tvil om, ikke evnene. – Læreren og ikonoklasten, del 1" },
	["cu_fiveseven_banana"] = { name = "Monkey Business", desc = "Det er en banan.\n\nNoen ganger er det greit å leke med maten" },
	["cu_galil_eco"] = { name = "Eco", desc = "Den er lakkert i hvitt og grønt, og detaljert med varmeoverføringsbilder.\n\nElite Crew vil ta på seg hvilket som helst oppdrag hvis det betaler godt nok." },
	["aq_famas_jinn"] = { name = "Djinn", desc = "Den er innlagt i gull og nikkel, og gravert med et bilde av en jinn.\n\nVær forsiktig med hva du ønsker deg" },
	["cu_m4a1_hyper_beast"] = { name = "Hyper Beast", desc = "It has been custom painted with a beastly creature in psychadelic colours.\n\nYou really want to impress me Booth? Make this black light sensitive - Rona Sabri, Rising Star" },
	["cu_mag7_redhot"] = { name = "PaintKit_cu_mac10_redhot_tag", desc = "PaintKit_cu_mac10_redhot" },
	["am_negev_glory"] = { name = "PaintKit_am_awp_glory_Tag", desc = "PaintKit_am_awp_glory" },
	["cu_mac10_neonrider"] = { name = "Neon Rider", desc = "Den er spesiallakkert med et bilde av en farlig motorsyklist.\n\nÉn del skytevåpen, to deler 80-tallet." },
	["cu_sawedoff_origami"] = { name = "Origami", desc = "Den er lakkert med et design som er inspirert av origami.\n\nDet tar tid å bygge noe vakkert, men bare et sekund å ødelegge det." },
	["cu_cz75_precision"] = { name = "Pole Position", desc = "Den er lakkert med et rødt og grått racingtema.\n\nVi får bare én sjanse, så sørg for å gjøre det riktig. – Felix Riley, kommandant" },
	["am_ump_racer"] = { name = "Grand Prix", desc = "Den er spesiallakkert med et gammeldags racingmotiv.\n\nIkke glem hjelmen din." },
	["am_aqua_flecks"] = { name = "Twilight Galaxy", desc = "am_aqua_flecks" },
	["cu_chronos_g3sg1"] = { name = "Chronos", desc = "Den er dekorert med hydrografikk av klokkemekanismer i psykedeliske farger, og varmeoverførte effekter.\n\nMed tiden er alt mulig." },
	["hy_hades"] = { name = "Hades", desc = "Den er lakkert i antikke greske hjelmer med hydrografikk.\n\nHvis hun ville ha meg til å holde et intervju, var det trolig en enklere måte å avtale det på. – Skjoldet og historiefortelleren, del 2" },
	["hy_icarus"] = { name = "Icarus Fell", desc = "Den er lakkert med et hydrografisk motiv av fjær og smeltet voks rundt en sol.\n\nTurners forræderi er min feil … Jeg må gjøre opp for meg. – Sebastien Hennequet, skarpskytter" },
	["cu_labyrinth"] = { name = "Minotaur's Labyrinth", desc = "Den er lakkert i en isometrisk labyrint med hydrografikk.\n\nDu kommer deg ikke unna meg." },
	["sp_labyrinth1"] = { name = "Asterion", desc = "Den er sprøytelakkert med en isometrisk labyrintsjablong.\n\nKonger er bare menn, og ingen mann bør tilbes. – Valeria Jenner, revolusjonær" },
	["sp_labyrinth2"] = { name = "Pathfinder", desc = "Den er sprøytelakkert med en isometrisk labyrintsjablong.\n\nPersonlig foretrekker jeg fjerde utgave, men kunden har alltid rett. – Booth, våpenhandler" },
	["sp_labyrinth3"] = { name = "Daedalus", desc = "Den er sprøytelakkert med en isometrisk labyrintsjablong.\n\nImogen … hvis de noen gang finner ut hva du gjorde, kan det koste oss alt. – En familieaffære, del 1" },
	["cu_medusa_awp"] = { name = "Medusa", desc = "Den er lakkert med et bilde av en gorgon.\n\nHvis du kan se meg, er du allerede død." },
	["gs_mother_of_pearl_elite"] = { name = "Duelist", desc = "Den har en mørk kunstig patina, og grepene er lakkert med perlemor.\n\nTyggegummi ikke inkludert." },
	["aa_pandora"] = { name = "Pandora's Box", desc = "Den er sprøytelakkert med tegnefilmånder.\n\nVerden står i brann, men vi har i det minste håp." },
	["cu_poseidon"] = { name = "Poseidon", desc = "Den er lakkert med en avbildning av en kamp mellom fiskene og Poseidon.\n\nTre kan holde en hemmelighet hvis to av dem er døde." },
	["hy_zodiac1"] = { name = "Moon in Libra", desc = "Den er lakkert med et hydrografisk dyrekretsmotiv.\n\nI dag er en god dag for å finne kjærligheten og drepe fiendene dine." },
	["hy_zodiac2"] = { name = "Sun in Leo", desc = "Den er lakkert med et hydrografisk dyrekretsmotiv.\n\nDet blir en tung måned for fiendene dine." },
	["hy_zodiac3"] = { name = "Shipping Forecast", desc = "Den er lakkert med et hydrografisk dyrekretsmotiv.\n\nHvem vet hva fremtiden bringer." },
	["so_khaki_green"] = { name = "Para Green", desc = "Den har individuelle deler sprøytelakkert i solide farger fra en kakigrønn og svart fargepalett.\n\nHvem han var, forandrer ikke hvem han er blitt. Ikke vær bekymret, Felix … Jeg skal stoppe ham – Ridderen og læreren, del 2" },
	["cu_anime_aug"] = { name = "Akihabara Accept", desc = "Den er dekorert med varmeoverført vinyl av omslaget til et animeblad.\n\nYatta!" },
	["am_bamboo_jungle"] = { name = "Hydroponic", desc = "Den er lakkert med et bambusmotiv med metallisk lakk.\n\nLegg merke til hvordan børsemaker Yukako brukte treverket på AK-en for å fremheve det frodige temaet sitt … det er ingen tvil: Hydroponisk er like vakker og dødelig som naturen selv. – Imogen, våpenhandler under opplæring" },
	["hy_bamboo_jungle_ink"] = { name = "Bamboo Print", desc = "Den er lakkert med hydrografikk av penselmalt bambus.\n\nSett inn skuddordspill her." },
	["hy_bamboo_jungle_black"] = { name = "Bamboo Shadow", desc = "Den er lakkert med hydrografikk av penselmalt bambus.\n\nKotaro mistet sønnen til dette våpenet … og én dag skal han bruke det til å stoppe den ansvarlige." },
	["hy_bamboo_jungle"] = { name = "Bamboo Forest", desc = "Den er lakkert med hydrografikk av penselmalt bambus.\n\nJeg mener fremdeles den burde hatt en panda. – Booth, våpenhandler" },
	["am_geometric_steps"] = { name = "Aqua Terrace", desc = "Den er lakkert med et geometrisk motiv i metalliske farger.\n\nSinnsro nå …" },
	["hy_geometric_steps"] = { name = "Geo Steps", desc = "Den er lakkert med hydrografikk i et geometrisk motiv." },
	["hy_geometric_steps_green"] = { name = "Counter Terrace", desc = "Den er lakkert med hydrografikk i et geometrisk motiv.\n\nHei Sabri, du bør ta denne … den er høylytt som deg. – Carmen Cocinero, ekstraksjonsekspert" },
	["hy_geometric_steps_yellow"] = { name = "Terrace", desc = "Den er lakkert med hydrografikk i et geometrisk motiv.\n\nDu er for tillitsfull, Valeria … det kommer til å få deg drept. – Franz Kriegeld, taktiker i Phoenix" },
	["hy_kimono_diamonds"] = { name = "Neon Kimono", desc = "Den er lakkert med hydrografikk i et geometrisk motiv.\n\nJeg vet at jeg ber om mye … Turner var som en sønn for deg. – Ridderen og læreren, del 1" },
	["hy_kimono_diamonds_orange"] = { name = "Orange Kimono", desc = "Den er lakkert med hydrografikk i et geometrisk motiv.\n\nTradisjoner er sterke saker." },
	["hy_kimono_diamonds_red"] = { name = "Crimson Kimono", desc = "Den er lakkert med hydrografikk i et geometrisk motiv.\n\nTurner, alle menn kan knekkes … man må bare finne det rette trykkpunktet. – Forræderen og sannhetssøkeren, del 2" },
	["sp_kimono_diamonds"] = { name = "Mint Kimono", desc = "Den er sprøytelakkert med et geometrisk motiv.\n\nKom, Booth, la meg vise deg hva jeg har jobbet med. – Yukako, børsemaker" },
	["am_seastorm"] = { name = "Midnight Storm", desc = "Den er lakkert med hydrografikk av en stormfull sjø over en blå metallisk grunning.\n\nJeg hater deg ikke, Sebastien … jeg synes synd på deg. – Chase Turner, avhopper fra koalisjonen" },
	["am_seastorm_blood"] = { name = "Sunset Storm 壱", desc = "Den er lakkert med hydrografikk av en stormfull sjø over en rød metallisk grunning.\n\nDu tror det er det samme, men se en gang til … finesse utgjør hele forskjellen." },
	["am_seastorm_shojo"] = { name = "Sunset Storm 弐", desc = "am_seastorm_shojo" },
	["am_kimono_sunrise"] = { name = "Daybreak", desc = "Den er lakkert med en soloppgang i metalliske farger.\n\nSolen står opp like ens for både redelige og uredelige." },
	["am_so_keycolors"] = { name = "Impact Drill", desc = "am_so_keycolors" },
	["so_aqua"] = { name = "Seabird", desc = "Den har individuelle deler sprøytelakkert i solide farger fra en turkis og lysebrun fargepalett.\n\nMin." },
	["cu_ak47_courage_alt"] = { name = "Aquamarine Revenge", desc = "Den er lakkert med et bilde av delfiner.\n\nEr det ekko her?" },
	["cu_cz75a_chastizer"] = { name = "Yellow Jacket", desc = "Den er lakkert med buede former.\n\nDans som en sommerfugl, stikk som et nådeløst, ondsinnet insekt." },
	["am_famas_dots"] = { name = "Neural Net", desc = "Den er lakkert i et gjennomsiktig mønster med hydrografikk, over en metallisk grunning.\n\nJeg vet. Men det var det rette å gjøre … – En familieaffære, del 2" },
	["cu_galilar_particles"] = { name = "Rocket Pop", desc = "Den er lakkert med et grafisk design med striper og pikselerte partikler.\n\nPerfekt for en varm sommerdag." },
	["aq_glock18_flames_blue"] = { name = "Bunsen Burner", desc = "Den har en blå patina som er blitt pusset av på deler av glidestykket for å skape et grafisk flammedesign.\n\nBANK, BANK." },
	["cu_m4a4_evil_daimyo"] = { name = "Evil Daimyo", desc = "Den er lakkert med et grafisk design i rødt og svart.\n\nCarmen. Jeg fant ham. – Onien og valkyrjen, del 1" },
	["cu_mp7_nemsis"] = { name = "Nemesis", desc = "Den er lakkert med et bilde av et metallisk monster.\n\nDet er ute etter deg." },
	["am_mp9_nitrogen"] = { name = "Ruby Poison Dart", desc = "Den er lakkert med røde og lilla farger over en svart grunning.\n\nHvem sier at diamanter er en jentes beste venn?" },
	["cu_negev_annihilator"] = { name = "Loudmouth", desc = "Den er lakkert med et uhyggelig design og så patinert.\n\nKom tilbake, jeg snakker til deg!" },
	["cu_nova_ranger"] = { name = "Ranger", desc = "Den er lakkert med en hydrografikk av penselstrøk og detaljert med varmeoverføringsbilder.\n\nHvem holder tellingen?" },
	["aq_p2000_boom"] = { name = "Handgun", desc = "Den er lakkert med en gestikulerende hånd som sikter.\n\nIkke mer fryd og gammen." },
	["cu_ump45_uproar"] = { name = "Riot", desc = "Den er lakkert med en kombinasjon av hydrografikk og overføringsbilder.\n\nHvis du ikke ville ha utilsiktet skade, burde du vært mer presis … – Javier Alviso, Phoenix' knyttneve" },
	["cu_usp_progressiv"] = { name = "Torque", desc = "Den er lakkert med et svart, hvitt og gult design.\n\nDe manipulerer deg, Kotaro. Hvis du ikke kan se det, har du større problemer enn du er klar over … – Felix Riley, kommandant" },
	["cu_ak47_winter_sport"] = { name = "Frontside Misty", desc = "Den er lakkert med sprakende arktiske farger.\n\nJeg liker å jobbe i snøen … det etterlater seg alltid et vakkert bilde. – Javier Alviso, Phoenix' knyttneve" },
	["cu_dualberretta_dragons"] = { name = "Dualing Dragons", desc = "Den har drager gravert inn i glidestykket og løpet.\n\nMarian var alltid kulere enn Sylvia." },
	["cu_famas_lenta"] = { name = "Survivor Z", desc = "Den er lakkert med en sjablong laget av maskeringsteip og så patinert.\n\nHva er rødt og hvitt og helautomatisk?" },
	["gs_g3sg1_flux_purple"] = { name = "Flux", desc = "Den er lakkert med metalliske farger i lilla og sølv.\n\nEn plan er en liste over ting som ikke skjer." },
	["gs_galil_nightwing"] = { name = "Stone Cold", desc = "Den er lakkert delvis med metallisk blåfarge. Kolben og magasinet viser frem designerens merke.\n\nTil slutt er du nødt til å trå ut av mentorens skygge." },
	["gs_glock18_wrathys"] = { name = "Wraiths", desc = "Den har fortapte sjeler lakkert på glidestykket.\n\nFørst bryter den gjennom mørket, så bryter den gjennom skyggen." },
	["gs_m249_nebula_crusader"] = { name = "Nebula Crusader", desc = "Den er lakkert som en klassisk arkademaskin.\n\nDu kan bruke den, men du må putte på en tier først." },
	["gs_m4a1s_snakebite_gold"] = { name = "Golden Coil", desc = "Den er lakkert med en hydrografikk av en angripende slange.\n\nHoggormen kan hogge til fra hvor som helst." },
	["cu_mac10_alekhya_duo"] = { name = "Rangeen", desc = "Den er lakkert med et motiv fra antikkens Egypt.\n\nKan du stå imot det vrede blikket?" },
	["cu_mag7_myrcene"] = { name = "Cobalt Core", desc = "Den er lakkert med et futuristisk grafisk design.\n\nHold ham trygg, Carmen. – Valkyrjen og elskeren, del 1" },
	["cu_mp7_classified"] = { name = "Special Delivery", desc = "Den er –SENSURERT–\n\nHvis jeg gjør som du vil, lar du meg gå? – Phoenix og historiefortelleren, del 2" },
	["hy_p250_crackshot"] = { name = "Wingshot", desc = "Den er lakkert med fargesprakende hydrografikk.\n\nAv og til er et lite dytt alt som skal til for å få det du vil ha. – Franz Kriegeld, taktiker i Phoenix" },
	["gs_scar20_peacemaker03"] = { name = "Green Marine", desc = "Den er lakkert med et kamuflasjemønster i metalliske farger.\n\nHør etter, folkens … Izaki og Cocinero er kanskje på tyvperm, men oppdraget vårt er det samme. Vi skal redde Alex Kincaide. – Felix Riley, kommandant" },
	["cu_ssg08_technicality"] = { name = "Big Iron", desc = "Den er lakkert med gul og oransje hydrografikk og så lettere patinert.\n\nEn seier med kryss i margen er fremdeles en seier. – Rona Sabri, kommende stjerne" },
	["cu_usp_kill_confirmed"] = { name = "Kill Confirmed", desc = "Den er lakkert med et bilde av en kule som knuser en skalle.\n\nTo i brystet, én i hodet." },
	["aq_xm1014_scumbria"] = { name = "Scumbria", desc = "Den er subtilt lakkert med metalliske farger.\n\nIkke vær for kjapp: Det kan finnes andre måter å tiltrekke Valerias oppmerksomhet … – En fars kjærlighet, del 3" },
	["cu_ak47_point_disarray"] = { name = "Point Disarray", desc = "Den er lakkert med geometrisk hydrografikk.\n\nPå nært hold er det kaos … fra avstand er det vakkert. – Franz Kriegeld, taktiker i Phoenix" },
	["am_aug_jumble"] = { name = "Ricochet", desc = "Den er lakkert med et knutedesign i to fargetoner.\n\nKotaro trenger ikke beskyttelsen vår. – Valkyrjen og elskeren, del 2" },
	["cu_bizon_noxious"] = { name = "Fuel Rod", desc = "Den er lakkert for å gi et inntrykk av radioaktiv ammunisjon.\n\nAv og til har fotsoldatene overtaket." },
	["aq_deagle_corinthian"] = { name = "Corinthian", desc = "Den er gravert med laser og har et grep av lær.\n\nUtholder. Tror. Håper. Tåler." },
	["cu_fiveseven_retrobution"] = { name = "Retrobution", desc = "Den er lakkert med retro hydrografikk.\n\nEnkelte ting går aldri av moten." },
	["cu_g3sg1_executioner"] = { name = "The Executioner", desc = "Den er lakkert med en grusom fremvisning av knokler.\n\nJeg tar alltid et trofé. – Javier Alviso, Phoenix' knyttneve" },
	["gs_m4a4_royal_squire"] = { name = "Royal Paladin", desc = "Den er gravert og lakkert forsiktig for å gi et inntrykk av storslagenhet.\n\nDenne telefonsamtalen fant aldri sted, skjønner du? – Ridderen og faderen, del 1" },
	["cu_negev_impact"] = { name = "Power Loader", desc = "Den er lakkert med hydrografikk som ligner på tungt maskineri.\n\nFryktet av dronninger. Elsket av løpere." },
	["am_p2000_imperial_red"] = { name = "Imperial", desc = "Den er gravert med laser og lakkert i metallisk rødt og gult.\n\nFølelsene mine har ingen betydning, Keo, jeg har et keiserrike å beskytte. – Booth, våpenhandler" },
	["cu_p90_shapewood"] = { name = "Shapewood", desc = "Trekolben er utskåret for hånd, pusset og laminert.\n\nPinsett medfølger ikke." },
	["gs_sawedoff_necromancer"] = { name = "Yorick", desc = "Den er lakkert med hydrografikk av en skalle og håndlakkert med gulldetaljer.\n\nRosencrantz og Guildenstern hadde aldri en sjanse …" },
	["hy_scar20_jungler"] = { name = "Outbreak", desc = "Den er lakkert med fargesprakende grønntoner.\n\nValeria blir djervere … tiden er inne for å ta kampen til henne. – Felix Riley, kommandant" },
	["gs_sg553_tiger_moth"] = { name = "Tiger Moth", desc = "Den er lakkert med et møllvingemønster.\n\nValeria blir djervere … tiden er inne for å ta kampen til henne. – Felix Riley, kommandant" },
	["cu_tec9_avalanche"] = { name = "Avalanche", desc = "Den er lakkert med elegant og futuristisk hydrografikk.\n\nVi må være smarte med hvilke trekk vi gjør mot henne. Et galt steg, så slår hun ned på oss begge. – Slangen og sannhetssøkeren" },
	["aq_xm1014_hot_rod"] = { name = "Teclu Burner", desc = "Det er brukt metallisk maling til å lage flammer.\n\nAv og til er ikke en bunsenbrenner nok …" },
	["gs_ak47_supercharged"] = { name = "Fuel Injector", desc = "Riflen er lakkert i lys gul, og magasinet er lakkert for å se ut som maskineri.\n\nLev livet et kvart magasin om gangen." },
	["cu_bizon_citizen"] = { name = "Photic Zone", desc = "Den er lakkert med et kamuflasjemønster detaljert med selvlysende lakk.\n\nDet er ikke lyden av brytende bølger du hører …" },
	["aq_deserteagle_kumichodragon"] = { name = "Kumicho Dragon", desc = "Den har lasergraverte drager på glidestykket og grepet.\n\nJeg er en stor tilhenger av virket ditt, Yukako, vi bør snakkes … – Huxley, konkurransen" },
	["cu_fiveseven_augmented"] = { name = "Triumvirate", desc = "Den er lakkert med et lyseblått digitalt kamuflasjemønster samt et håndlakkert glidestykke.\n\nJeg profiterer ikke på krig, jeg profiterer på menneskets natur … – Booth, våpenhandler" },
	["gs_glock18_award"] = { name = "Royal Legion", desc = "Den er omhyggelig gravert.\n\nNaomi forstår at hun en dag vil dø for Valeria." },
	["gs_m4a4_pioneer"] = { name = "The Battlestar", desc = "Alle kantene er klippet av kvitteringen på kjøpet.\n\nPass deg for de som taler om vakttårnet." },
	["am_mac10_electricity"] = { name = "Lapis Gator", desc = "Den er lakkert med hydrografikk av fargerikt alligatorskinn.\n\nLuftputefartøy medfølger ikke." },
	["gs_mag7_praetorian"] = { name = "Praetorian", desc = "Den er lakkert med distinkte metalliske farger.\n\nSpiret formes." },
	["sp_mp7_impire"] = { name = "Impire", desc = "Den er lakkert med hydrografikk av smådjevler.\n\nØdeleggelse har aldri vært så søtt." },
	["cu_ssg08_necropos"] = { name = "Necropos", desc = "Den er lakkert med ondskapsfulle runer.\n\nHver snekker trenger sin hammer, hver skredder sin tein …" },
	["gs_tec9_jambiya"] = { name = "Jambiya", desc = "Den er lakkert og lasergravert med mønster fra Midtøsten.\n\nShahrazad fortalte 1000 historier … dette blir den siste du hører." },
	["gs_usp_voltage"] = { name = "Lead Conduit", desc = "Den er gravert på lyddemperen og glidestykket.\n\nDu fikk det du ville ha, og vet du hva det betyr? – Booth, våpenhandler" },
	["cu_aug_swallows"] = { name = "Fleet Flock", desc = "Den er lakkert med hydrografikk av fugler som flyr gjennom skyene.\n\nNoen fugler representerer fred og ro … det gjelder ikke disse." },
	["cu_bizon_Curse"] = { name = "Judgement of Anubis", desc = "Den er lakkert med et egyptisk tema.\n\nAvtrekkeren er lettere enn en fjær." },
	["gs_cz75a_redastor"] = { name = "Red Astor", desc = "Den er håndlakkert med røde og hvite detaljer.\n\nBooth er blitt synonymt med familiedrama, og hvem har tid til drama når vi snakker forretninger? – Huxley, konkurransen" },
	["gs_dualberettas_ventilators"] = { name = "Ventilators", desc = "Disse pistolene er elegant lakkert i krom.\n\nEt våpen for kunstnere, av kunstnere." },
	["sp_g3sg1_militiaorange"] = { name = "Orange Crash", desc = "Sjablonger og oransje sprøytemaling gir denne riflen sitt egenartede utseende.\n\nBli vår tids Shere Khan." },
	["gs_galilar_incenerator"] = { name = "Firefight", desc = "Den har høyrøde detaljer og et håndlakkert ikon.\n\nBooth bestilte dette våpenet til Valeria i et forsøk på å ordne opp i forholdet til Phoenix." },
	["cu_m249_spectre"] = { name = "Spectre", desc = "Den er lakkert på en elegant og moderne måte.\n\nPhoenix' borgerkrig er i ferd med å begynne." },
	["cu_m4a1s_soultaker"] = { name = "Chantico's Fire", desc = "Den er lakkert i sprakende farger og detaljert med et smilefjes på kolben.\n\nBeskytt det som er ditt." },
	["am_mp9_bioleak"] = { name = "Bioleak", desc = "Forskjellige grønntoner skaper en illusjon av kjemiske utslipp.\n\nUNNGÅ DIREKTE EKSPONERING" },
	["hy_p2000_oceani"] = { name = "Oceanic", desc = "Den har en svart grunning og er betonet med blå mønster.\n\nHar noen hørt fra Kotaro eller Carmen? – Felix Riley, kommanderende offiser" },
	["cu_p250_asiimov"] = { name = "Asiimov", desc = "Den er lakkert med et sci-fi-design.\n\nHvis du tror jeg trenger en rifle for å drepe en mann, da har du ikke peiling på hvem du snakker med … – Mikha Biton, skarpskytter i Phoenix" },
	["gs_sawedoff_fubar"] = { name = "Fubar", desc = "Denne godt brukte haglen har tellestreker skåret inn i løpet.\n\nDet begynner med et smell … og slutter med stillhet." },
	["cu_sg553_atlas"] = { name = "Atlas", desc = "Den er blitt påført hydrografikk av moderne kamuflasje.\n\nDette var en gang et design øremerket koalisjonsstyrken, men Huxley drev industrispionasje for å gjøre den eksklusiv for Phoenix." },
	["gs_ssg08_armacore"] = { name = "Ghost Crusader", desc = "Den er lakkert hvit og påført isblå detaljer.\n\nJeg kan aldri erstatte det som ble tatt fra oss … men jeg kan ta enda mer fra dem. – Phoenix og den innvidde, del 2" },
	["am_tec9_redblast"] = { name = "Re-Entry", desc = "Løpet er påført et overføringsbilde av flammer.\n\nJeg misliker å ha rett hele tiden. – Carmen Cocinero, ekstraksjonsekspert" },
	["cu_ump45_primalsaber"] = { name = "Primal Saber", desc = "Den er påført et overføringsbilde av en sabeltanntiger.\n\nHvert rovdyr møter til slutt sitt endelikt." },
	["cu_xm1014_spectrum"] = { name = "Black Tie", desc = "Denne haglen er en åpenbaring i svart og hvitt krom, og passer best til formelle anledninger.\n\nVi har Izaki og Cocinero. Trenger du dem til noe, eller kan jeg bare drepe dem nå? – Leiesoldaten og slangen, del 1" },
	["am_marbleized_g"] = { name = "Gamma Doppler", desc = "Den er lakkert i metallisk svart og hvit med marmorering, og så blanklakkert." },
	["gs_autotronic"] = { name = "Autotronic", desc = "Den er anodisert rød og bruker stålnetting for å lette vekten." },
	["am_marked_up"] = { name = "Freehand", desc = "Den er lakkert svart og lilla, og så dekorert med en metallisk tusj." },
	["gs_aug_aristocrat"] = { name = "Aristocrat", desc = "Den har sølvfargede filigranapplikasjoner over en lyseblå anodisert grunning.\n\nFor de styrtrike." },
	["gs_awp_phobos"] = { name = "Phobos", desc = "Den er bygd av metallpaneler og slitesterke elektroniske komponenter.\n\nBygg en bedre verden." },
	["cu_five_seven_daimyo"] = { name = "Violent Daimyo", desc = "Den er lakkert med et grafisk design i lilla og svart.\n\nHvordan vil du herske?" },
	["cu_glock_wasteland_rebel"] = { name = "Wasteland Rebel", desc = "Den er patinert, blokktrykket og lakkert med graffiti.\n\nYt tributt!" },
	["gs_m4a1_mecha_industries"] = { name = "Mecha Industries", desc = "Den er bygd av herdede keramikkplater.\n\nMed helt ny teknologi." },
	["cu_m4a4_desolate_space"] = { name = "Desolate Space", desc = "Den er lakkert med et verdensromtema.\n\n«Vi mistet kontakten.»" },
	["aq_mac_10_alien_camo"] = { name = "Carnivore", desc = "Den er lakkert med rød og lilla hydrografikk over en metallisk grunning.\n\nGjennomvarmes før servering." },
	["aq_nova_sci_fi"] = { name = "Exo", desc = "Den er lakkert med hydrografikk over et panelmotiv i sølv over en lillamønstret grunning.\n\nDet er innsiden som teller." },
	["gs_p2000_imperial_dragon"] = { name = "Imperial Dragon", desc = "Den er lakkert med motiv av en drage med røde metalliske farger.\n\nSe mot vest." },
	["gs_p250_metal_panels"] = { name = "Iron Clad", desc = "Den er dekorert med klinkede metallplater.\n\nPålitelighet og sikkerhet garantert." },
	["gs_p90_full_throttle"] = { name = "Chopper", desc = "Den er lakkert med et flammemotiv i oransje og blå metalliske farger.\n\nKløtsj medfølger ikke." },
	["gs_pp_bizon_harvester"] = { name = "Harvester", desc = "Den er dekorert med et biomekanisk motiv.\n\nBiomekanisk eksperimentering gjort riktig." },
	["cu_r8_cybersport"] = { name = "Reboot", desc = "Den er dekorert med røde detaljer over plater i sølv og svart.\n\n«Har du prøvd å slå den av og på igjen?»" },
	["cu_sawed_off_lime"] = { name = "Limelight", desc = "Den er lakkert med buer i limegrønt og hvitt.\n\nAlle øyne er vendt mot deg." },
	["gs_scar20_bloodsport"] = { name = "Bloodsport", desc = "Den er dekket i overføringsbilder av hvite logoer over en rød og svart hydrografikk.\n\nAntiterroristene er sponset av…" },
	["cu_sg553_aerial"] = { name = "Aerial", desc = "Den er lakkert i sølv og gult, og påført et overføringsbilde av en hvit vinge.\n\nEtabler luftoverlegenhet." },
	["am_tec_9_sea_salt"] = { name = "Ice Cap", desc = "Den er lakkert med blå og hvit abstrakt hydrografikk.\n\nSenk motstanderne." },
	["bloodhound_black_silver"] = { name = "Charred", desc = "De er laget av klassisk svart og mykt lær.\n\nUtfordringsmynter er bra, men de spiller ikke blod når du slår noen med baksiden av hånden. – Carmen Cocinero, ekstraksjonsekspert" },
	["bloodhound_snakeskin_brass"] = { name = "Snakebite", desc = "De er laget av en kombinasjon av lær og slangeskinn.\n\nFor å være ærlig … ingen savner Sergei. – Hans Kriegeld, taktiker i Phoenix" },
	["bloodhound_metallic"] = { name = "Bronzed", desc = "Læret er blitt farget i kanonbronse.\n\nOperasjon Bloodhound markerte slutten for den egenrådige skarpskytteren Chase Turner." },
	["bloodhound_guerrilla"] = { name = "Guerrilla", desc = "De er laget av en blanding av brunt lær og syntetisk lær med et kamuflasjetrykk.\n\nValeria planlegger gjengjeldelse. Ingen tvil om det … – Sebastien Hennequet, skarpskytter" },
	["handwrap_leathery"] = { name = "Leather", desc = "De er laget av lær, gasbind og onde intensjoner.\n\nBli beryktet." },
	["handwrap_camo_grey"] = { name = "Spruce DDPAT", desc = "Den ytre bindingen er trykket med grå digital kamuflasje.\n\nNoen folk sier de er sterke … andre viser det." },
	["handwrap_red_slaughter"] = { name = "Slaughter", desc = "De er farget i høyrødt, så det er vanskelig å se hvor stoffet ender og blodflekkene begynner.\n\nHvem elsker ikke å jobbe med hendene?" },
	["handwrap_fabric_orange_camo"] = { name = "Badlands", desc = "Disse gjør-det-selv-hanskene er laget av skrap.\n\nFelix ser gjennom fingrene med den ulovlige bokseligaen i koalisjonsstyrken." },
	["slick_black"] = { name = "Lunar Weave", desc = "Midnattsblå semsket lær er flettet inn med svart lær for å gi disse hanskene et tidløst preg.\n\nGjør at man ikke får blod på hendene … i overført betydning." },
	["slick_military"] = { name = "Convoy", desc = "De er laget av en blanding av brunt, mykt lær og farget semsket skinn.\n\nNoen ganger må man vise diskresjon." },
	["slick_red"] = { name = "Crimson Weave", desc = "Svart semsket skinn er flettet inn med skarlagenrødt lær for å gi disse hanskene et tidløst preg.\n\nSett spor etter deg, ikke fingeravtrykk." },
	["slick_snakeskin_yellow"] = { name = "Diamondback", desc = "De er laget av en blanding av beige lær, svart lær og slangeskinn.\n\nStandardutgaven er for fjols … – Imogen, våpenhandler under opplæring" },
	["sporty_green"] = { name = "Hedge Maze", desc = "Disse grønne og hvite hanskene ble laget av Icarus Athletics.\n\nBare pyser frykter å fly nær solen." },
