	["sporty_light_blue"] = { name = "Superconductor", desc = "Disse blå og svarte hanskene er perfekte for den som ønsker å være fenomenal.\n\nDe vil ikke ha bråk." },
	["sporty_military"] = { name = "Arid", desc = "Flere bruntoner og subtil kamuflasje gir disse hanskene et elegant utseende.\n\nHvis vi skal være helter, så kan vi like greit se slik ut også … – Rona Sabri, kommende stjerne" },
	["specialist_ddpat_green_camo"] = { name = "Forest DDPAT", desc = "Håndsydd lær er kombinert med robust stoff trykket med DDPAT.\n\nEnkelte liker ikke å være skitten på hendene." },
	["specialist_kimono_diamonds_red"] = { name = "Crimson Kimono", desc = "Dette paret med svarte hansker er detaljert med et tydelig rødt diamantmønster.\n\nBegynn å se rødt." },
