	["cu_AK47_Anarchy"] = { name = "Neon Revolution", desc = "Den er påført en eklektisk blanding av hydrografiske overføringsbilder, og så drypplakkert.\n\nIngen selvmordsskvadron er komplett uten." },
	["gs_AUG_Syd_Mead"] = { name = "Syd Mead", desc = "Den er designet av kunstneren Syd Mead.\n\nFør gav han oss blikk inn i fremtiden, nå har han gitt oss ansvar for den …" },
	["gs_CZ75_Tread"] = { name = "Imprint", desc = "Den er omhyggelig gravert for hånd.\n\nMoteriktige våpen har tatt Tsjekkia med storm." },
	["aq_Desert_Eagle_Constable"] = { name = "Directive", desc = "Den er designet for å hjelpe fremtidens politifolk med å stoppe krek.\n\nDitt trekk …" },
	["gs_FAMAS_Rally"] = { name = "Roll Cage", desc = "Den er blitt påført overføringsbilder som ser ut som en gjørmete bil.\n\nSikkerheten først." },
	["aq_Five_Seven_Scumbria"] = { name = "Scumbria", desc = "Den er lakkert med svake striper.\n\nDu kan ikke la ham dø, Felix. Du må redde ham. – Datteren og ridderen, del 1" },
	["gs_G3SG1_Ventilator"] = { name = "Ventilator", desc = "Den er elegant lakkert i krom og svart, og har en spesiallaget gummikolbe.\n\nIngen grunn til bekymring, Naomi. Jeg skal sørge for at Felix får det han fortjener. – Mikha Biton, skarpskytter i Phoenix" },
	["cu_Glock18_Weasel"] = { name = "Weasel", desc = "Den er lakkert med hydrografikk av Bobby, den pøbelaktige røyskatten. Ikke kødd med Bobby.\n\nHan er kanskje søt, men han biter." },
	["cu_MAG7_Tribal"] = { name = "Petroglyph", desc = "Den er lakkert for å gi illusjonen av en helleristning.\n\nKonflikt har eksistert siden den første huleboeren lærte seg å plukke opp steiner. – Booth, våpenhandler" },
	["cu_MP9_Narcis"] = { name = "Airlock", desc = "Den er lakkert hvit og har et magasin i en sterk rødfarge.\n\nPerfekt til å skyte brødristere." },
	["hy_Negev_Dazzle"] = { name = "Dazzle", desc = "Den er dekket i overføringsbilder i blå og hvite sebrastriper.\n\nEndelig, et våpen for quizelskere." },
	["cu_P90_Grimm"] = { name = "Grim", desc = "Den er lakkert med hydrografikk av morske spøkelser, og deretter tørrbørstet med grønne detaljer.\n\nImogen … selger du meg et våpen eller en fløyelsplakat? – Rona Sabri, kommende stjerne" },
	["gs_SCAR20_Powercore"] = { name = "Powercore", desc = "Den er lakkert med grønne og gule detaljer, og så påført en USB-kode for rask ekspedering.\n\nRegel nummer 1: Utfordringer krever tilfredsstillelse." },
	["cu_SG556_Triarch"] = { name = "Triarch", desc = "Riflen ble bestilt av kongelige, og er påført ørkenkamuflasje.\n\nGi dem en påminnelse om kjærligheten din." },
	["gs_TEC9_Supercharged"] = { name = "Fuel Injector", desc = "Våpenet er lakkert gult, og magasinet er påført hydrografikk av en beltemotor. Et håndsydd lærgrep gjør denne klassikeren fra Seattle fullkommen.\n\nMannskap medfølger ikke." },
	["cu_UMP45_Metritera"] = { name = "Briefing", desc = "Den er påført hydrografikk av et topografisk kart.\n\nDette blir et kort møte …" },
	["hy_XM1014_Fractal_Blue"] = { name = "Slipstream", desc = "Den er spesiallakkert med røykfargede gråtoner og livlige blåfarger.\n\nTålmodighet, Elliott; de har ikke utspilt sin rolle ennå … – Leiesoldaten og slangen, del 2" },
	["am_czv2_mf"] = { name = "Polymer", desc = "Glidestykket har et overføringsbilde som ser ut som polymer.\n\nDu har ikke med Phoenix å gjøre lenger. Vi vet å ta vare på våre egne … – Datteren og ridderen, del 2" },
