	["cu_ump_clutch_kick"] = { name = "Wild Child", desc = "Under skisser av kuler, en krone og andre design danner striper i neonfarger grunningen på denne lakkerte UMP-45-en.\n\nKonseptet er enkelt – det er utførelsen som er vanskelig." },
	["cu_mp9_superlight"] = { name = "Featherweight", desc = "Den er lakkert i svart og hvitt så den ser porøs ut, som legger mindre vekt på brukeren.\n\nEn god skytter skylder ikke på verktøyene." },
	["gs_scar_fragments_black"] = { name = "Fragments", desc = "Den er lakkert i rødmetall for å skape illusjonen av at våpenets geometri er endret.\n\nEt bruddstykke av fantasien." },
	["cu_glock_moon_rabbit"] = { name = "Umbral Rabbit", desc = "Den er lakkert i en drømmeaktig scene av en mystisk kanin som hopper foran en fullmåne.\n\nTa spranget!" },
	["cu_m4a4_temukau"] = { name = "Temukau", desc = "Den er lakkert i en japansk animasjonsstil og fremstiller en kvinnelig AT-agent som bekjemper et stormangrep fra T-siden.\n\n«Hold stand!»" },
	["cu_mac10_sakkaku"] = { name = "Sakkaku", desc = "Under visse lysforhold gløder øynene på denne lakkerte MAC-10-en røde.\n\nGjør oppfatningen din om til virkeligheten deres." },
	["cu_p250_rebuilt"] = { name = "Re.built", desc = "Den er lakkert i sammenflettede trekanter og andre rene, minimale design.\n\nAlle gode ting er ni." },
	["cu_mp5sd_quick_liquidation"] = { name = "Liquidation", desc = "Den mørke grunningen og nøye utvalgte røde og blå detaljer gjør at denne lakkerte MP5-SD-en ser ut som om den gløder under omgivelseslys.\n\nStille refleksjon." },
	["gs_r8_banana"] = { name = "Banana Cannon", desc = "Den er lakkert så den ligner en veldig moden banan.\n\nTa en banan." },
	["gs_p90_neoqueen"] = { name = "Neoqueen", desc = "Den er lakkert i en blanding av militære og sci-fi-aktige stiler\n\nLaget spesielt for fart og spenning." },
	["cu_sg553_cyberforce"] = { name = "Cyberforce", desc = "CYBERFORCE INC-logoen er lakkert over en rød og svart grunning.\n\n«CYBERFORCE INC: Vi sikrer fremtiden din så du ikke trenger!»" },
	["cu_tec9_freedom"] = { name = "Rebel", desc = "Denne lakkerte TEC-9-en er dekket av løst tilknyttede design med en dempet fargepalett.\n\nEtt skudd, ett drap, én runde om gangen." },
	["gs_revolver_acanthus_bronze"] = { name = "Inlay", desc = "It has been custom painted to resemble acanthus engravings and a marble grip.\n\nOpulence in the palm of your hand" },
	["gs_ak47_strone"] = { name = "Steel Delta", desc = "The lines of this custom paint job resemble grooves on a topographical map.\n\nBleed between the lines" },
	["gs_awp_strone"] = { name = "Black Nile", desc = "The lines of this custom paint job resemble grooves on a topographical map.\n\nBleed between the lines" },
	["cu_glock_ramzes"] = { name = "Ramese's Reach", desc = "The Nile river has been custom painted on the slide and the grip depicts Ramesses I, the founding pharaoh of ancient Egypt's 19th Dynasty.\n\n\"My people reach for their Gods, and I am here to connect them\"" },
	["cu_famas_holo_ocean"] = { name = "Waters of Nephthys", desc = "The blues on this custom painted FAMAS shift as lighting conditions change.\n\nWater always wins" },
	["cu_m249_scarab"] = { name = "Submerged", desc = "It has been custom painted using teal-colored desert camouflage and environments as inspiration.\n\n\"WE'VE BEEN SET UP! THEY'RE EVERYWHERE!\"" },
	["gs_m4a1s_milspec"] = { name = "Mud-Spec", desc = "A custom black and brown camouflage has been applied.\n\nBackup has arrived" },
	["gs_m4a4_ra"] = { name = "Eye of Horus", desc = "It has been custom painted with a white base, gold accents, and the Egyptian falcon god Horus.\n\nRise above the rest" },
	["cu_mac10_scarab"] = { name = "Echoing Sands", desc = "It has been custom painted using desert camouflage and environments as inspiration. A scarab has been painted under the wire form butt.\n\n\"WE'VE BEEN SET UP! THEY'RE EVERYWHERE!\"" },
	["gs_mag7_goold"] = { name = "Copper Coated", desc = "It has been custom painted to look like it was held under a stream of liquid copper.\n\nThis was an accident, not a mistake..." },
	["gs_mp7_strone"] = { name = "Sunbaked", desc = "The lines of this custom paint job resemble grooves on a topographical map.\n\nBleed between the lines" },
	["gs_nova_sobek"] = { name = "Sobek's Bite", desc = "This custom paint job features gold and black Egyptian inspired designs.\n\nFrom the water comes chaos" },
	["gs_p250_apep"] = { name = "Apep's Curse", desc = "It has been custom painted using Egyptian patterns and materials as inspiration.\n\nIn opposition of Ra" },
	["hy_dune_trap"] = { name = "Snake Pit", desc = "A custom pattern of snakes and amphibians has been applied.\n\nActing on ill intentions" },
	["cu_p90_scarab_of_wisdom"] = { name = "ScaraB Rush", desc = "It has been custom painted with scarabs and Egyptian inspired designs.\n\nResurrection requires death, and death requires rushing" },
	["gs_ssg08_anubis"] = { name = "Azure Glyph", desc = "It has been custom painted with blue water, Egyptian hieroglyphs, and finished with wood running the length of the weapon.\n\nFlood warning" },
	["cu_tec9_mummy"] = { name = "Mummy's Rot", desc = "It has been custom painted to resemble a mummy. A cobra with green eyes has been painted beneath the rear sight.\n\nKeep this under wraps" },
	["gs_usps_tactical_camo"] = { name = "Desert Tactical", desc = "It has been custom painted with an olive-colored tactical camouflage.\n\nBase models don't have to be boring" },
	["cu_xm1014_pharaoh"] = { name = "Hieroglyph", desc = "It has been custom painted with Egyptian hieroglyphs and ornaments.\n\nThe moral of the story" },
	["sp_nukestripe"] = { name = "sp_nukestripe", desc = "Den er sprøytelakkert i et radiologisk faremønster." },
	["sp_spray_waves_bravo"] = { name = "sp_spray_waves_bravo", desc = "Denne suveniren fra Seaside er sprøytelakkert på frihånd med korte, tykke linjer i kontrastfulle farger.\n\nPerfekt for en opprører på farten." },
	["hy_ocean_bravo"] = { name = "hy_ocean_bravo", desc = "Denne suveniren fra Seaside er lakkert i blå kamuflasje med hydrografikk.\n\nVerdenen vår er full av intrige, men av og til er det meningen at kamuflasje skal synes. – Booth, våpenhandler" },
	["sp_spitfire_famas_bravo"] = { name = "sp_spitfire_famas_bravo", desc = "Denne suveniren fra Cache er lakkert med en haimunn i samme stil som en flynese.\n\nJester er død." },
	["hy_tile_bravo"] = { name = "hy_tile_bravo", desc = "Denne suveniren fra Ali er lakkert i et mosaikkmønster med hydrografikk.\n\nTålmodighet er en dyd." },
	["an_navy_bravo"] = { name = "an_navy_bravo", desc = "Denne suveniren fra Ali er påført en krom grunning og blanklakkert i gjennomsiktig, anodisert, marin effektlakk.\n\nJeg har allerede mistet en mann til Valerias løgner … Jeg har ingen planer om å miste flere. – Felix Riley, kommanderende offiser" },
	["sp_hazard_bravo"] = { name = "sp_hazard_bravo", desc = "Denne suveniren fra Siege er sprøytelakkert i et stripete faremønster.\n\nADGANG FORBUDT" },
	["sp_tape_dots_bravo"] = { name = "sp_tape_dots_bravo", desc = "Denne suveniren fra Gwalior er sprøytelakkert med revne teipbiter og perforert metall som sjablonger.\n\nIkke bekymre deg … forretningene tar seg snart opp. – Booth, våpenhandler" },
	["hy_ddpat_bravo"] = { name = "hy_ddpat_bravo", desc = "Denne suveniren fra Ruins er lakkert i et «Digital Disruptive»-mønster (DDPAT) med hydrografikk.\n\nSelv om du ikke kan se den, kommer du absolutt til å høre den." },
	["so_jungle_bravo"] = { name = "so_jungle_bravo", desc = "Denne suveniren fra Ruins har individuelle deler sprøytelakkert i solide farger fra en jungelfargepalett.\n\nFor de med en appetitt for ødeleggelse." },
	["so_tornado_bravo"] = { name = "so_tornado_bravo", desc = "Denne suveniren fra Ali har individuelle deler sprøytelakkert i solide farger fra en tornadofargepalett.\n\nOrd er vind, men vind kan drepe." },
	["so_sand_bravo"] = { name = "so_sand_bravo", desc = "Denne suveniren fra Gwalior har individuelle deler sprøytelakkert i solide farger fra en sandfargepalett.\n\nGonzo-journalisten Alex Kincaide forsvant etter at han reiste til Maghreb for å dekke Operasjon Vanguard." },
	["so_olive_bravo"] = { name = "so_olive_bravo", desc = "Denne suveniren fra Cache har individuelle deler sprøytelakkert i solide farger fra en olivenfargepalett.\n\nIkke ta seieren for gitt." },
	["an_gunmetal_bravo"] = { name = "an_gunmetal_bravo", desc = "Denne suveniren fra Siege er lakkert med en anodisert våpenmetalleffektmaling over en krom grunning.\n\nDu kjenner ikke Felix Riley like godt som meg … mannen er urokkelig. – Forræderen og sannhetssøkeren, del 1" },
	["am_ossify_blue_p2000_bravo"] = { name = "am_ossify_blue_p2000_bravo", desc = "Denne suveniren fra Seaside er lakkert i et gjennomsiktig, blått og abstrakt mønster med hydrografikk, over en metallisk grunning.\n\nBølger kan brytes, men ikke engasjementet vårt. – Kotaro Izaki, inntrengingsekspert " },
	["am_crumple_bravo"] = { name = "am_crumple_bravo", desc = "Denne suveniren fra Agency er lakkert i et mangekantet mønster med metalliske malinger med ulike refleksjonsevner, over en krom grunning.\n\nNed med blyantene, opp med hendene." },
	["aq_steel"] = { name = "aq_steel", desc = "Den er fortsatt i perfekt operasjonell stand selv om de ytre overflatene har rustet.\n\nNoen mennesker trenger ikke å skjule hvor skitne deres gjerninger er" },
	["hy_hex"] = { name = "hy_hex", desc = "Den er lakkert i et sekskantet mønster med hydrografikk." },
	["hy_camo_large"] = { name = "hy_camo_large", desc = "Den er lakkert i et overdimensjonert kamuflasjemønster med hydrografikk." },
	["am_ddpatdense"] = { name = "am_ddpatdense", desc = "Den er dekket i en metallisk folie stemplet med et digitalt kamuflasjemønster." },
	["twigs"] = { name = "twigs", desc = "Den er sprøytelakkert på frihånd med kvister som sjablonger." },
	["varicamo"] = { name = "varicamo", desc = "Den er lakkert i et VariCamo-mønster med hydrografikk.\n\nGjenoppbygging følger kun i ødeleggelsens kjølvann." },
	["aq_damascus_knife"] = { name = "aq_damascus_knife", desc = "Den er smidd fra en barre laget av to forskjellige typer karbonstål.\n\nEndelig et våpen som kan måle seg med besluttsomheten din." },
	["am_crystallized"] = { name = "am_crystallized", desc = "Den er lakkert med metallisk lakk, og det er brukt en krystalliserende maske for å lage et mønster.\n\nAlle vil gjøre et inntrykk." },
	["snakeskin"] = { name = "snakeskin", desc = "Den er lakkert i et slangeskinnsmønster med hydrografikk.\n\nJeg vet at du ikke tror på saken … og når jeg avslører deg, vil Valeria ha hodet ditt på et fat. – Skjoldet og slangen, del 1" },
	["cu_usp-s_elegant"] = { name = "cu_usp-s_elegant", desc = "Den er lakkert koboltblå, og AT-logoen er påført sleiden med en sjablong.\n\nJeg kan følge prosedyren og få ut sju, eller så jeg kan gjøre det på min måte og redde alle ti … opp til deg. – Carmen Cocinero, ekstraksjonsekspert" },
	["hy_plaid2"] = { name = "hy_plaid2", desc = "Den er lakkert i et rutete, musegrått og blå-grønt mønster med hydrografikk.\n\nDet er ingen sekkepipe, men den spiller en melodi før hver begravelse." },
	["cu_fiveseven_urban_hazard"] = { name = "cu_fiveseven_urban_hazard", desc = "Den er lakkert i et urbant kamuflasjemønster med røde detaljer.\n\nHvert år samler Booth verdens fremste våpendesignere for å vise frem deres nyeste verk." },
	["an_emerald"] = { name = "an_emerald", desc = "Den er påført en krom grunning og blanklakkert med en gjennomsiktig, anodisert smaragdgrønn effektlakk.\n\nEr dette det den store Sebastien Hennequet er blitt redusert til? En grinete skolefrøken? Hva skjedde med deg … – Læreren og ikonoklasten, del 2" },
	["so_keycolors"] = { name = "so_keycolors", desc = "Den har individuelle deler sprøytelakkert i solide farger fra en blå og oransje fargepalett.\n\nGjør et stort inntrykk." },
	["cu_awp_mastery"] = { name = "cu_awp_mastery", desc = "Den er lakkert med en kombinasjon av hydrografikk og forsiktig bruk av sjablonger og detaljert med varmeoverføringsbilder.\n\nChase Turner var en bra mann … du har store sko å fylle. – Phoenix og den innvidde, del 1" },
	["aq_dualberettas_cartel"] = { name = "aq_dualberettas_cartel", desc = "Den er gravert med skjelett, blomster og slanger.\n\nDet er grunnen til at Huxley gjør alt grovarbeidet, alt vi trenger å gjøre er å lede henne fremover … – Slangen og sannhetssøkeren, del 2" },
	["aq_famas_contour"] = { name = "aq_famas_contour", desc = "Den er lakkert med et moderne rødt og grått design som fyller ut våpenets form.\n\nVi er alltid sterkere sammen." },
	["cu_nova_hyperbeast"] = { name = "cu_nova_hyperbeast", desc = "Den er spesiallakkert med et beist i psykedeliske farger.\n\nDe kaller deg Oni, sant? Et slikt skummelt navn på en så trist mann – Elliot Kingsman, leiesoldat" },
	["hy_ocean_knife"] = { name = "hy_ocean_knife", desc = "Den er lakkert med hydrografikk i blå kamuflasje." },
	["cu_m4a1s_printstream"] = { name = "cu_m4a1s_printstream", desc = "Den er spesiallakkert med et skarpt svart og hvitt design med perleaktig finish.\n\nWHITE_1; BLACK_1; PEARLESCENT_1; SILENCED_1;" },
	["cu_usp_printstream"] = { name = "cu_usp_printstream", desc = "Den er spesiallakkert med et skarpt svart og hvitt design med perleaktig finish.\n\nWHITE_1; BLACK_1; PEARLESCENT_1; SILENCED_1; PISTOL_1;" },
}
